INSERT INTO `rc_notice` VALUES (1491148,'管理员发的第二条通知','！！！',NULL,1,'2024-05-15 21:55:20','2024-05-15 21:55:20'),(4715211,'test','222',632254,NULL,'2024-05-21 12:09:04','2024-05-21 12:09:04'),(6394784,'系统通知','尊敬的用户：您好！为了给您提供更好的服务，在线课程管理系统将于2024.5.10进行维护升级。维护期间，系统功能可能会受到一定影响，具体如下：1.部分功能暂时无法使用。2.可能出现页面加载缓慢或显示异常。我们将尽最大努力缩短维护时间，确保系统尽快恢复正常运行。如您在使用过程中遇到任何问题，请及时联系我们的客服团队，联系电话18241576022感谢您的理解与支持，给您带来的不便，敬请谅解！',632254,1,'2024-05-13 18:30:23','2024-05-15 21:50:49'),(6821071,'课程发布作业的通知','各位同学：大家好！通过在线课程管理系统，我将为大家发布本次课程的作业。具体信息如下：作业名称：高数上作业1提交截止时间：2024.5.16作业要求及相关说明已在系统中详细列出，请大家及时登录系统查看并认真完成作业。如有任何疑问，请随时与我联系',4131802,NULL,'2024-05-14 16:50:50','2024-05-14 16:50:50'),(9917806,'关于考试批改的通知','各位同学：你们好！本次课程考试的批改工作已经完成。大家可以登录在线课程管理系统查看自己的考试成绩。请大家认真核对成绩，如有疑问，请在2024.5.16前与我联系。希望大家能从考试中总结经验，不断进步。',9700719,NULL,'2024-05-13 00:02:26','2024-05-13 00:02:26');
